import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import { Routes, Route, BrowserRouter } from "react-router-dom";

import { Landing } from "./components/Landing";
import { Tietopankkiin } from "./components/Tietopankkiin";

import { Study3 } from "./components/questions/Study3";
import { Study4 } from "./components/questions/Study4";
import { Study7 } from "./components/questions/Study7";
import { Study11 } from "./components/questions/Study11";
import { Study15 } from "./components/questions/Study15";
import { Study19 } from "./components/questions/Study19";
import { Study20 } from "./components/questions/Study20";
import { Study21 } from "./components/questions/Study21";

import { Info5} from "./components/info/Info5";
import { Info6} from "./components/info/Info6";
import { Info8} from "./components/info/Info8";
import { Info9} from "./components/info/Info9";
import { Info10} from "./components/info/Info10";
import { Info12} from "./components/info/Info12";
import { Info13} from "./components/info/Info13";
import { Info14} from "./components/info/Info14";
import { Info16} from "./components/info/Info16";
import { Info17} from "./components/info/Info17";
import { Info18} from "./components/info/Info18";
import { Info22} from "./components/info/Info22";
import { Info23} from "./components/info/Info23";
import { Info24} from "./components/info/Info24";
import { Info25} from "./components/info/Info25";
import { Info26} from "./components/info/Info26";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/navigator/" element={<Landing />} />
        <Route exact path="/dashboard/" element={<Tietopankkiin />} />

        <Route path="/study/3" element={<Study3 />} />
        <Route path="/study/4" element={<Study4 />} />
        <Route path="/study/7" element={<Study7 />} />
        <Route path="/study/11" element={<Study11 />} />
        <Route path="/study/15" element={<Study15 />} />
        <Route path="/study/19" element={<Study19 />} />
        <Route path="/study/20" element={<Study20 />} />
        <Route path="/study/21" element={<Study21 />} />

        <Route path="/info/5" element={<Info5 />} />
        <Route path="/info/6" element={<Info6 />} />
        <Route path="/info/8" element={<Info8 />} />
        <Route path="/info/9" element={<Info9 />} />
        <Route path="/info/10" element={<Info10 />} />
        <Route path="/info/12" element={<Info12 />} />
        <Route path="/info/13" element={<Info13 />} />
        <Route path="/info/14" element={<Info14 />} />
        <Route path="/info/16" element={<Info16 />} />
        <Route path="/info/17" element={<Info17 />} />
        <Route path="/info/18" element={<Info18 />} />
        <Route path="/info/22" element={<Info22 />} />
        <Route path="/info/23" element={<Info23 />} />
        <Route path="/info/24" element={<Info24 />} />
        <Route path="/info/25" element={<Info25 />} />
        <Route path="/info/26" element={<Info26 />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
